// src/components/Login.jsx

import React, { useState } from 'react';
import { AuthService } from '../services/AuthService'; // Asegúrate de importar tu servicio

const Login = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState(null);

    const handleLogin = async (e) => {
        e.preventDefault();
        try {
            // Llama al servicio de inicio de sesión
            const loginData = await AuthService.login(username, password);
            console.log('Inicio de sesión exitoso:', loginData);

            // Ahora llama a fetchApiKey si el inicio de sesión fue exitoso
            const apiKey = await AuthService.fetchApiKey(username);
            console.log('API Key:', apiKey);
            // Aquí puedes almacenar la API Key en el contexto o estado según sea necesario
        } catch (error) {
            setError(error.message); // Maneja el error
        }
    };

    return (
        <form onSubmit={handleLogin}>
            <input
                type="text"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                placeholder="Username"
                required
            />
            <input
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                placeholder="Password"
                required
            />
            <button type="submit">Login</button>
            {error && <p style={{ color: 'red' }}>{error}</p>} {/* Muestra el error si existe */}
        </form>
    );
};

export default Login;
